import React, { Component } from 'react';
import './style.css';
import Background from '../6.jpg';


export class Header extends Component {



    render() {
        var sectionStyle = {
            width: "100%",
            height: "400px",
            backgroundImage: "url(" + { Background } + ")"
        };
        return (
            <div className="header">

                <section style={ sectionStyle }>
                </section>

            </div>
        );
    }
}
